import logoDark from './img/logo-dark.png'

function AboutUs()
{
    return (
        <div style={{ backgroundImage: "url(/img/aboutusBG.png)", height: "1600px" }} id="aboutUsBG">
            <div>
                <p><img src={logoDark} alt="logo" style={{ height: "240px" }} /></p>
                <p className="display-2">Our Mission</p>
            </div>
        </div>
    )
}

export default AboutUs
